import React from 'react'

function dashboardT() {

    const [prn, setPrn] = useState("");

    function submitForm(event) {
        event.preventDefault()
        const entry = { prn: prn };
        console.log("Form submitted")
        AuthService.login(entry).then(
            (response) => {
                console.log(response.user.role)
                if(response.user.role === 'Student'){
                    AuthService.verify(response.token).then(
                        (response)=>{
                            console.log(response);
                            navigate("/dashboard", {
                                state: {
                                  response
                                }
                              });
                            window.location.reload();    
                        },
                        (error)=>{
                            console.log("Error" + error);
                        }
                    )
                } else{
                    alert("Teacher Account");
                }
                
            },
            (error) => {
                console.log("Error" + error);
            });
    }

  return (
    <>
        <div className='container'>
            <form onSubmit={submitForm} action="" method="POST">
                <div className="mb-3">
                    <label htmlFor="exampleInputEmail1" className="form-label">Enter PRN</label>
                    <input type="email" value={prn} onChange={(event) => { setEmail(event.target.value) }} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" autoComplete='off' placeholder='abc@email.com' required />
                </div>
                <button type="submit" className="btn btn-primary">Submit</button>
            </form>
        </div>
    </>
  )
}

export default dashboardT
